  true,\n\t\"url\": null,\n\t\"notes\": \"The Runway Incursion database contains records
  of events involving the incorrect presence of an aircraft, vehicle or person on
  the protected area of a surface designated for the landing and take off of aircraft.
  \ Runway incursion events are reported by the respective air traffic control tower.
  \ The data reflect the ICAO definition of a runway incursion as well as the related
  severity categories.  The runway incursion database is maintained by the FAA Office
  of Runway Safety.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
